import React, { useEffect, useState } from "react";
import Dashboard from "./dashboard/dashboard";
import Login from "./LoginPage/login";

export default function VerificaLogin() {
  useEffect(() => {
  const token = localStorage.getItem('token')

  const pagina = () => {
    switch (token) {
			case (token === null):
				return <Login />;
			case (token !== null):
				return <Dashboard/>;
			default:
				return <Login />;
		}
  }

}, [])
  return {pagina}
}
